import React from "react";

import { Hero, Content } from "../components";

export class ContactPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      email: "",
      message: "",
      disabled: false,
      emailSent: null,
    };
  }

  render() {
    return (
      <div>
        <Hero title={this.props.title} />
        <Content>
          <Form></Form>
        </Content>
      </div>
    );
  }
}
